/*
 Sidebar de la page admin 

 @author : Noula Darlin
 github : github.com/darlino
 

*/

import logo from '../assets/img/logo.png'
import React , {useState} from 'react'
import '../assets/css/sidebar.css'
export const Sidebar = () => {
    return (
        <div className="col-2 d-flex justify-content-center flex-column p-4 side">
            <div className="col-8 rounded-circle">
                <img src={logo} alt="logo" className="img-thumbnail rounded-circle" style={{ width :"100%" ,height : "100%" ,objectFit : "cover"}}></img>
            </div>
            
        </div>
            
        
    )
}
